	      <Home />
	    </Route>
	    <Route path="/igersmiami">
	      <IgersMiami />
	    </Route>
	    <Route path="/blog">
		<Blog />
	    </Route>
	  </Switch>
	</Router>
	</div>
  );
}

export default App;
